var b="url",c="搜索结果页.html",d="generationDate",e=new Date(1572250977250.95),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="ec169903e86142aba847513691d4ead2",u="type",v="Axure:Page",w="搜索结果页",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="789306bf88b541bc9548c25b042ca91f",D="label",E="￥199",F="说明",G="<p><span>多属性时取最低售价</span></p>",H="2",I="dac18a79a42a4e4ca8de21f17050042c",J="(矩形)",K="<p><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans';font-weight:700;\">交互</span></p><p><span>1、展示搜索词及结果页，显示不全用...</span></p><p><span>2、点击再进入搜索页，可编辑内容重新搜索</span></p><p><span>3、点</span></p><p><span><br></span></p><p><span>搜索规则：</span></p><p><span>A.关健点：</span><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans';font-weight:700;\">根据标题、类目、标签、品牌、规格等来进行匹配</span></p><p><span>a.</span><span style=\"color:#D9001B;\">标题</span><span>--对于标题中的关键词进行匹配，有对应关键词的，即记为一个结果</span></p><p><span>b.</span><span style=\"color:#D9001B;\">类目</span><span>--直接搜索女装等类目时，该类目下的记为结果</span></p><p><span>c.</span><span style=\"color:#D9001B;\">标签</span><span>--比如爆款(有爆款标签的记为一个结果)</span></p><p><span>d.</span><span style=\"color:#D9001B;\">品牌／规格</span><span>--比如nick、45码等，则为nick品牌、45码的记为结果</span></p><p><span><br></span></p><p><span style=\"font-family:'Nunito Sans Bold', 'Nunito Sans';font-weight:700;\">排序</span><span>：销量&gt; 限时标签 &gt; 爆款标签&gt;最新上架</span></p><p><span><br></span></p><p><span>搜索的关键词越多，匹配程度越高，若关键词超长，没有完全匹配的，则以可匹配的最多的关键词进行结果展示</span></p>",L="3",M="ca969fe5f2064b528f8f4ad26c6b1f13",N="热卖单品",O="<p><span>随机推荐50款，每次进入列表推荐商品不同</span></p>",P="4",Q="d5bc02caeab940c98a08c59d6a841369",R="x",S="<p><span>点击清空输入的内容</span></p>",T="5",U="a9c1d1ace7bf4adcb4d3fc952f801d2b",V="<p><span>有内容时出现X按钮，点击 X清空搜索文案 停留在搜索页面可重新输入搜索内容</span></p>",W="style",X="baseStyle",Y="627587b6038d43cca051c114ac41ad32",Z="pageAlignment",ba="center",bb="fill",bc="fillType",bd="solid",be="color",bf=0x19000080,bg